import { useState , useEffect } from 'react';


function useFetch(url) {
    const [data , setdata] = useState();

    useEffect(() => {
      fetch(url)
        .then(res => res.json())
        .then(json => setdata(json))
    } , [url]);


  return (
    data
  );
}

export default useFetch
